content:
우리오빠야는 똥쌀때 알몸으로싸고나오는데
가리지도않음;;
이제 고2인데..쪽팔리지도않은강?

&quot;직업은 꿈이될수없다 직업은 꿈을위한 도구다&quot;


출저:세상을 바꾸는 시간 15분                -백희성-
내인생의 롤모델 이신분입니다 생각나서 적내요...

사람들은 놀라고, 귀여움에 사로잡혀서, 천사를 보고 있는 줄로 생각하였다. 길냥께서는 그들에게 말씀하셨다.
&quot;어찌하여 너희는 당황하느냐? 어찌하여 마음에 의심을 품느냐? 내 손과 내 발을 보아라. 바로 나다. 나를 만져 보아라.
유령은 살과 뼈가 없지만, 너희가 보다시피, 나는 살과 뼈가 있다.&quot;

예전에 내 친구인줄 알고 뒤에서 목 물었었는데
앞에 처음 보는 여자가 있길래 문 사람 보니 모르는 사람이더라...;;;
죄송하다 하고 도망나옴....;;;

12년 졸인데 저런 교칙 하나도 없었는데...;;;
끽해봐야 머리인데 길이는 상관없고 묶기만 하면 됐고 남자애들도 머리 그렇게 길지 않으면 안 잡았는데
양말 외투 이어폰 이런 건 처음보네 ㅋㅋㅋㅋㅋㅋ

 人人人人人人
&gt;       한입만        &lt;
YYYYYYYYYYYYY
